def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":

    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.convert_dtypes()

    agg_blocks: List[Block] = []
    new_items: List[int] = []

    for block in data.blocks:
        locs = block.mgr_locs.as_array

        try:
            result, _ = self.grouper.aggregate(
                block.values, how, axis=1, min_count=min_count
            )
            if isinstance(result, DataFrame):
                result = result.values
            # Casting the result back to the original dtype
            result = maybe_convert_objects(result, convert_numeric=False, convert_datetime=False)
            agg_block = make_block(result.T, placement=locs, klass=Block)

            new_items.extend(locs)
            agg_blocks.append(agg_block)
        except NotImplementedError:
            continue

    if not (agg_blocks):
        raise DataError("No numeric types to aggregate")

    indexer = np.argsort(new_items)
    agg_items = data.items.take(indexer)

    for idx, blk in enumerate(agg_blocks):
        loc = len(blk.mgr_locs)
        blk.mgr_locs = indexer[np.arange(idx * loc, (idx + 1) * loc)]

    return agg_blocks, agg_items
